import "./App.css";
import "./Components/QuoteBox";
import QuoteBox from "./Components/QuoteBox";
import Footer from "./Components/Footer";
class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="container">
          <h1>Metal Quote Generator</h1>

          <QuoteBox />
        </div>
        <br />
        <Footer />
      </div>
    );
  }
}

export default App;
